import React, { Component } from 'react'
import FoodContent from "./FoodContent"

export default class FoodSearch extends Component {
  render() {
    return (
      <div>
        <form>
          <input placeholder="ENTER FOOD"></input>
          <button>SEARCH</button>
        </form>
        <FoodContent />
      </div>
    )
  }
}
